public class HitRateCalculator {
    public static void main(String[] args) {
        // Create a JavaSparkContext
        JavaSparkContext sc = new JavaSparkContext();

        // Load the onsite attributed data and top frequent queries
        JavaRDD<String> onsiteData = sc.textFile("path/to/onsite_data.txt");
        JavaRDD<String> topQueries = sc.textFile("path/to/top_queries.txt");

        // Convert the top frequent queries to a HashSet for efficient lookup
        final Map<String, Long> cache = new HashMap<>();
        for (String query : topQueries.collect()) {
            cache.put(query, System.currentTimeMillis());
        }

        // Calculate the hit rate
        long totalRequests = onsiteData.count();
        long cacheHits = onsiteData.map(new Function<String, Boolean>() {
            @Override
            public Boolean call(String record) throws Exception {
                String query = record.split(",")[0]; // Assuming query is the first field
                Long timestamp = Long.parseLong(record.split(",")[1]); // Assuming timestamp is the second field

                if (cache.containsKey(query)) {
                    long cachedTime = cache.get(query);
                    if (timestamp - cachedTime <= 12 * 60 * 60 * 1000) { // Check if the cached entry is within 12 hours
                        return true; // Cache hit
                    }
                }
                cache.put(query, timestamp); // Cache the query for future lookups
                return false; // Cache miss
            }
        }).filter(new Function<Boolean, Boolean>() {
            @Override
            public Boolean call(Boolean aBoolean) throws Exception {
                return aBoolean;
            }
        }).count();

        double hitRate = (double) cacheHits / totalRequests;

        System.out.println("Total Requests: " + totalRequests);
        System.out.println("Cache Hits: " + cacheHits);
        System.out.println("Hit Rate: " + hitRate);

        // Stop the SparkContext
        sc.stop();
    }
}
```

