```jsx
import React from 'react';

const Layout = ({ children, className }) => {
  return (
    <div className={`layout ${className}`}>
      {children}
    </div>
  );
};

export default Layout;
```

In this example, the `Layout` component is a simple wrapper that accepts `children` and a `className` prop. The `className` prop is used to conditionally apply the styles for the two variants.

To define the styles for the variants, you can use Tailwind CSS classes in combination with the `className` prop. Here's an example of how you can use the `Layout` component with the two variants:

```jsx
import React from 'react';
import Layout from './Layout';

const App = () => {
  return (
    <div>
      <Layout className="max-w-full">
        <h1>Full-width Layout</h1>
        <p>This content will span the full width of the container.</p>
      </Layout>

      <Layout className="max-w-7xl mx-auto">
        <h1>Centered Layout</h1>
        <p>This content will be centered and have a maximum width of 1200px.</p>
      </Layout>
    </div>
  );
};

export default App;
```

In this example, we have two instances of the `Layout` component:

1. The first instance uses `className="max-w-full"`, which sets the `max-width` to 100% using the `max-w-full` class from Tailwind CSS. This will make the content span the full width of the container.

2. The second instance uses `className="max-w-7xl mx-auto"`, which sets the `max-width` to 1200px using the `max-w-7xl` class and centers the content horizontally using the `mx-auto` class from Tailwind CSS.

