    <table class="table table-striped table-bordered table-sortable">
        <thead>
          <th>Header 1</th>
                <th>Header 2</th>
                <th>Header 3</th>

</thead>
        <tbody>
          Row 1, Cell 1 Row 1, Cell 2 Row 1, Cell 3
Row 2, Cell 1 Row 2, Cell 2 Row 2, Cell 3
</tbody>
    </table>

    <script>
        document.addEventListener('DOMContentLoaded', () => {
            const table = document.querySelector('.table-sortable');
            const headers = table.querySelectorAll('th');
            const tableBody = table.querySelector('tbody');
            const rows = tableBody.querySelectorAll('tr');

            // Add a click event listener to each header
            headers.forEach(header => {
                header.addEventListener('click', () => {
                    const columnIndex = Array.from(headers).indexOf(header);
                    const type = header.getAttribute('data-type');
                    const isAscending = header.classList.contains('th-sort-asc');

                    sortTable(columnIndex, type, isAscending);
                });
            });

            // Sort the table based on the clicked header
            function sortTable(columnIndex, type, isAscending) {
                const direction = isAscending ? 'asc' : 'desc';
                const sortedRows = Array.from(rows).sort((rowA, rowB) => {
                    const cellA = rowA.querySelectorAll('td')[columnIndex].textContent;
                    const cellB = rowB.querySelectorAll('td')[columnIndex].textContent;

                    if (type === 'number') {
                        return direction === 'asc' ? cellA - cellB : cellB - cellA;
                    } else {
                        return direction === 'asc' ? cellA.localeCompare(cellB) : cellB.localeCompare(cellA);
                    }
                });

                // Update the table body with the sorted rows
                tableBody.append(...sortedRows);

                // Update the header classes
                headers.forEach(header => {
                    header.classList.remove('th-sort-asc', 'th-sort-desc');
                });
                const clickedHeader = headers[columnIndex];
                clickedHeader.classList.add(direction === 'asc' ? 'th-sort-desc' : 'th-sort-asc');
            }
        });
    </script>
</body>
</html>
```
