  for (let i = 0; i < numEntities; i++) {
    const entity = entities[i];
    const id = entity.id & 0xf;
    const size = entity.size & 0x7;

    let byteIndex = Math.floor(bitIndex / 8);
    let shift = bitIndex % 8;

    view[byteIndex] |= id << shift;
    bitIndex += 4;

    byteIndex = Math.floor(bitIndex / 8);
    shift = bitIndex % 8;

    if (shift + 3 <= 8) {
      view[byteIndex] |= size << shift;
    } else {
      const remainingBits = 8 - shift;
      view[byteIndex] |= size << shift;
      view[byteIndex + 1] |= size >> remainingBits;
    }

    bitIndex += 3;
  }

  return buffer;
}

function unpackEntities(buffer) {
