    let shift = bitIndex % 8;

    const id = (view[byteIndex] >> shift) & 0xf;
    bitIndex += 4;

    byteIndex = Math.floor(bitIndex / 8);
    shift = bitIndex % 8;

    let size;
    if (shift + 3 <= 8) {
      size = (view[byteIndex] >> shift) & 0x7;
    } else {
      const remainingBits = 8 - shift;
      size = (view[byteIndex] >> shift) | (view[byteIndex + 1] << remainingBits);
      size &= 0x7;
